import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  & > .container {
    display: flex;
    align-items: center;
    justify-content: space-between;
    & > .left {
      display: flex;
      align-items: center;
      & > .title {
        font-size: 40px;
        font-weight: bold;
      }
      & > button {
        cursor: pointer;
        margin-left: 20px;
        width: 131px;
        height: 44px;
        border-radius: 57px;
        background-color: #337dff;
        font-size: 16px;
        font-weight: bold;
        color: white;
      }
    }
    & > .right {
      display: flex;
      border: solid 1px #dbdbdb;
      width: 320px;
      height: 50px;
      border-radius: 10px;
      & > input {
        flex: 1;
      }
    }
  }
`;

function Search({ type }) {
  return (
    <Wrapper>
      <div className="container">
        <div className="left">
          <div className="title">{type === "ask" ? "고객문의" : "뭐임"}</div>
          {type === "ask" ? <button>문의글 작성</button> : undefined}
        </div>
        <div className="right">
          <input type="text" />
          <figure>
            <img src="/assets/common/search.svg" alt="검색" />
          </figure>
        </div>
      </div>
    </Wrapper>
  );
}

export default Search;
